import React, { Component } from "react";
import "./timeinput.css";
import Axios from "axios";

class timeinput extends Component {
  constructor(props) {
    super(props);
    this.state = {
      empoloyeeID: "",
      project_Name: "",
      p_Date: "",
      p_Start: "",
      p_End: "",
      clockTime: [],
    };
  }

  render() {
    return (
      <div>
        <h2>Add timesheet Record</h2>
      </div>
    );
  }
}

export default timeinput;
